import React from "react";
import Slider from "react-slick";
import "./Testimonia.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { Avatar } from "@material-ui/core";

const Testimonial = () => {
  return (
    <div>
      <Slider>
        <div>
          <Card img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSaXrFMnQrS3cdGFTB-UpG-5qMGMQyybPu7xg&usqp=CAU" />
        </div>
        <div>
          <Card img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSaXrFMnQrS3cdGFTB-UpG-5qMGMQyybPu7xg&usqp=CAU" />
        </div>
        <div>
          <Card img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSaXrFMnQrS3cdGFTB-UpG-5qMGMQyybPu7xg&usqp=CAU" />
        </div>
      </Slider>
    </div>
  );
};

const Card = ({ img }) => {
  return (
    <div className="card">
      <Avatar src={img} />
    </div>
  );
};

export default Testimonial;
